// Now define the function that does the EBL attenuation correction for the model by Gilmore et al. (2012)
void ebl_atten_gil(int size,double* en,double* lum,double redsh){
    gsl_interp_accel *acc_TeV =  gsl_interp_accel_alloc();
    gsl_interp_accel *acc_redshift =  gsl_interp_accel_alloc();
    gsl_spline2d *tau_gil = gsl_spline2d_alloc(gsl_interp2d_bicubic,57,101);
    gsl_spline2d_init(tau_gil,gil_redshift_table,gil_TeV_table,gil_ebl_table,57,101);
    
    if(redsh > gil_redshift_table[0] && redsh < gil_redshift_table[56]){
    	for (int k=0;k<size;k++){
    		if (lum[k] < 10){
    			continue;
    		} else if (en[k]/1.6 > gil_TeV_table[0] && en[k]/1.6 < gil_TeV_table[100]){
    			if (gsl_spline2d_eval(tau_gil,redsh,en[k]/1.6,acc_redshift,acc_TeV) >= 0.){
    				lum[k] = lum[k]*exp(-1.*gsl_spline2d_eval(tau_gil,redsh,en[k]/1.6,acc_redshift,acc_TeV));
    			}
    		}
    	}
    } else if(redsh < gil_redshift_table[0]){
    	std::cout << "Redshift is too small for EBL model(0.01 < redshift < 9.00). No interpolation possible." << std::endl;
    } else{
    	std::cout << "Redshift is too large for EBL model(0.01 < redshift < 9.00). No interpolation possible." << std::endl;
    }
    gsl_interp_accel_free(acc_TeV);
    gsl_interp_accel_free(acc_redshift);
    gsl_spline2d_free(tau_gil);
}
